    navigate('product');
  };

  return (
    <div className="App">

      <div>
        <button onClick={()=>{handleShowUseStateDemo()}}></button>
      </div>
      <div>
        This is the home page, its very bear bones
      </div>

      {/* this tells it where to load the children */}
      {/* <Outlet /> */}
    </div>
  );
}

export default App;
